import React, { Component } from "react";

export default class Blog extends Component {
  render() {
    return (
      <div className="blog">
        <div className="header">
          <div id="logo">
            <img src={require("./Logo.png")} alt="N/A" />
          </div>
        </div>
      </div>
    );
  }
}
